oxy_webhelp_navlinks = {"prt_print_documents_t-d4800e1755":{"topics":[{"title":"Printing to an external file","shortdesc":"<p class=\"shortdesc\">You can print document(s) to an external file, such as an ASCII or PostScript® file. The documents are not actually printed but saved in a file that you specify on your hard disk drive. In Windows®, you must set up a PostScript printer before printing to a file.<\/p>","href":"prt_print_to_a_file_t.html","attributes":{"data-id":"prt_print_to_a_file_t"},"menu":{"hasChildren":false},"tocID":"prt_print_to_a_file_t-d4800e1767","topics":[]},{"title":"Previewing a print job","shortdesc":"<p class=\"shortdesc\">You can preview a document's page layout before printing. You can also view page breaks. Previewing is useful because page breaks, word wrapping, margins, and other features can differ in print from their appearance on screen.<\/p>","href":"prt_preview_print_job_t.html","attributes":{"data-id":"prt_preview_print_job_t"},"menu":{"hasChildren":false},"tocID":"prt_preview_print_job_t-d4800e1789","topics":[]},{"title":"Printing a file attachment","shortdesc":"<p class=\"shortdesc\">Print an attachment from your browser. <\/p>","href":"prt_print_an_attachment_t.html","attributes":{"data-id":"prt_print_an_attachment_t"},"menu":{"hasChildren":false},"tocID":"prt_print_an_attachment_t-d4800e1802","topics":[]},{"title":"Printing framesets","shortdesc":"<p class=\"shortdesc\">You can print the framesets that display on your screen when you view an HCL Notes® application, as well as framesets that you see when you view Notes applications through the Notes browser.<\/p>","href":"prt_print_a_frameset_t.html","attributes":{"data-id":"prt_print_a_frameset_t"},"menu":{"hasChildren":false},"tocID":"prt_print_a_frameset_t-d4800e1815","topics":[]},{"title":"Setting up the page for printing","shortdesc":"<p class=\"shortdesc\">Use the Page Setup dialog box to set page margins, select a paper source, set page orientation, and more (availability of some options described below may depend on the printer and operating system you are using). <\/p>","href":"prt_setup_page_for_print_t.html","attributes":{"data-id":"prt_setup_page_for_print_t"},"menu":{"hasChildren":false},"tocID":"prt_setup_page_for_print_t-d4800e1837","topics":[]},{"title":"Selecting a different printer ","shortdesc":"<p class=\"shortdesc\">From the Print dialog box (<span class=\"ph menucascade\"><span class=\"ph uicontrol\">File<\/span><abbr title=\"and then\"> &gt; <\/abbr><span class=\"ph uicontrol\">Print<\/span><\/span> from the menu), you can select the printer where you want to send your print job.<\/p>","href":"prt_select_printer_t.html","attributes":{"data-id":"prt_select_printer_t"},"menu":{"hasChildren":false},"tocID":"prt_select_printer_t-d4800e1850","topics":[]}]}};